e.BusinessProcess.MainExtensions","ConfigId":"f8d16729-620a-4780-80dd-2c37f1ed6a3c","Editor":"businessprocess-vr-workflowactivity-customcode","Title":"Custom Code","Code":{"$type":"Vanrise.BusinessProcess.Entities.VRWorkflowCodeExpression, Vanrise.BusinessProcess.Entities","ConfigId":"46408cc8-8d65-4cac-b30a-1f625e6dc5ed","CodeExpression":"importedRows = new SOM.ST.Billing.Entities.TestBulkRows ();

if (attachments == null || attachments.Count == 0)
	throw new NullReferenceException ("There is no attachments.");

var fileManager = new Vanrise.Common.Business.VRFileManager ();
var headerRowExists = true;
List<string> worksheetHeaders;

foreach (var attachment in attachments)
{
	Vanrise.Entities.VRFile file = fileManager.GetFile (attachment.FileId);
	if (file == null)
		throw new Vanrise.Entities.DataIntegrityValidationException (string.Format ("File '{0}' was not found", attachment.FileId));
	if (file.Content == null)
		throw new Vanrise.Entities.DataIntegrityValidationException (string.Format ("File '{0}' is empty", attachment.FileId));

	byte[] bytes = file.Content;
	var fileStream = new System.IO.MemoryStream (bytes);

	var workbook = new Aspose.Cells.Workbook (fileStream);
	if (workbook.Worksheets == null || workbook.Worksheets.Count == 0)
		throw new Vanrise.Entities.DataIntegrityValidationException (string.Format ("Workbook created from file '{0}' does not contain any worksheets", attachment.FileId));

	Aspose.Cells.Worksheet worksheet = workbook.Worksheets.ElementAt (0);
	int startingRowIndex = 0;

	if (headerRowExists)
	{
		startingRowIndex = 1;
		worksheetHeaders = new List<string> ()
		{
			worksheet.Cells[0, 0].StringValue,
				worksheet.Cells[0, 1].StringValue
		};
	}
	else
	{
		worksheetHeaders = new List<string> () { "CustomerId", "CustomerCategory" };
	}

	for (int i = startingRowIndex; i < worksheet.Cells.Rows.Count; i++)
	{
		Aspose.Cells.Cell idCell = worksheet.Cells[i, 0], customerCategoryCell = worksheet.Cells[i, 1];

		string importedContactId, importedCustomerCategory;

		bool isImportedContactIdEmpty = Helper.IsStringEmpty (idCell.StringValue, out importedContactId);
		bool isImportedCustomerCategoryEmpty = Helper.IsStringEmpty (customerCategoryCell.StringValue, out importedCustomerCategory);

		if (!isImportedContactIdEmpty && !isImportedCustomerCategoryEmpty)
		{
			var importedRow = new SOM.ST.Billing.Entities.TestBulkRow()
			{
				ContactId = importedContactId,
					CustomerCategory = importedCustomerCategory
			};
			importedRows.Add (importedRow);
		}
	}
}"},"IsDisabled":false}},{"$type":"Vanrise.BusinessProcess.Entities.VRWorkflowActivity, Vanrise.BusinessProcess.Entities","VRWorkflowActivityId":"5aa0c0d9-a001-bdb6-97b0-c8efec2036ba","Settings":{"$type":"Vanrise.BusinessProcess.MainExtensions.VRWorkflowActivities.VRWorkflowForEachActivity, Vanrise.BusinessProcess.MainExtensions","ConfigId":"ba3a107d-20da-4456-ac70-a2948dfe3725","Editor":"businessprocess-vr-workflowactivity-foreach","Title":"ForEach","List":{"$type":"Vanrise.BusinessProcess.Entities.VRWorkflowCodeExpression, Vanrise.BusinessProcess.Entities","ConfigId":"46408cc8-8d65-4cac-b30a-1f625e6dc5ed","CodeExpression":"importedRows"},"IterationVariableName":"row","IterationVariableType":{"$type":"Vanrise.BusinessProcess.MainExtensions.VRWorkflowVariableTypes.VRWorkflowCustomClassType, Vanrise.BusinessProcess.MainExtensions","ConfigId":"a6078b0f-efa2-414f-8a25-549628da1762","FieldType":{"$type":"Vanrise.Entities.VRCustomClassType, Vanrise.Entities","Namespace":"SOM.ST.Billing.Entities","ClassName":"TestBulkRow"}},"Activity":{"$type":"Vanrise.BusinessProcess.Entities.VRWorkflowActivity, Vanrise.BusinessProcess.Entities","VRWorkflowActivityId":"8b955d4b-4566-91fc-d940-636e893ca6b5","Settings":{"$type":"Vanrise.BusinessProcess.MainExtensions.VRWorkflowActivities.VRWorkflowSequenceActivity, Vanrise.BusinessProcess.MainExtensions","ConfigId":"9292b3be-256f-400f-9bc6-a0423fa0b30f","Editor":"businessprocess-vr-workflowactivity-sequence","Title":"Sequence","Activities":{"$type":"Vanrise.BusinessProcess.Entities.VRWorkflowActivityCollection, Vanrise.BusinessProcess.Entities","$values":[{"$type":"Vanrise.BusinessProcess.Entities.VRWorkflowActivity, Vanrise.BusinessProcess.Entities","VRWorkflowActivityId":"6f15c426-afb6-80f6-1a5e-25e82c2f19ea","Settings":{"$type":"Vanrise.BusinessProcess.MainExtensions.VRWorkflowActivities.VRWorkflowAssignActivity, Vanrise.BusinessProcess.MainExtensions","ConfigId":"82c21f82-3636-4174-ba83-11709140d959","Editor":"businessprocess-vr-workfl