        var contractServiceProxy = new SOM.ST.Billing.Business.ContractServiceProxy ();
        var contracts = contractServiceProxy.GetCustomerContracts (null, null);
        var result = new List<string> ();

        foreach (var contract in contracts) {
            if (!string.IsNullOrEmpty (contract.PhoneNumber))
                result.Add (contract.PhoneNumber);
        }

        return result;
    }

    public bool CheckIfPhoneNumberExist (string phoneNumber) {
        var commonServiceProxy = new SOM.ST.Billing.Business.CommonServiceProxy ();
        var inventoryServiceProxy = new Inventory.Business.InventoryServiceProxy ();

        var isExistInBSCS = commonServiceProxy.CheckIfPhoneNumberExistInBSCS (phoneNumber);
        var isExistInInventory = inventoryServiceProxy.CheckIfPhoneNumberExistInInventory (phoneNumber);

        return isExistInBSCS && isExistInInventory;
    }
}"}}

{"$type":"Vanrise.Entities.VRNamespaceItemSettings, Vanrise.Entities","Code":{"$type":"Vanrise.Common.MainExtensions.VRDynamicCode.CustomCodeDynamicCodeSettings, Vanrise.Common.MainExtensions","ConfigId":"bdd289df-573c-44a1-9a95-d0de2ed9dd71","CustomCode":"public class PaymentManager {

    public List<SOM.ST.Billing.Entities.Installment> SimulatePaymentPlan (SOM.ST.Billing.Entities.WritePaymentPlanInput input) {
        var proxy = new SOM.ST.Billing.Business.InstalmentServiceProxy ();
        var wfEntityId = proxy.WorkflowEntitySearch (input.invoiceId);

        if (wfEntityId == null)
            throw new NullReferenceException (string.Format ("No workflow entity found for invoice with id'{0}'.", input.invoiceId));

        input.wfEntityId = wfEntityId;
        input.status = SOM.ST.Billing.Entities.PaymentPlanStatus.Activated;
        input.simulateMode = true;

        return proxy.WritePaymentPlan (input);
    }

    public void ApplyPaymentPlan (SOM.ST.Billing.Entities.WritePaymentPlanInput input) {
        var proxy = new SOM.ST.Billing.Business.InstalmentServiceProxy ();

        proxy.FinancialAllocationWrite (input.customerId, input.discountAmount.amount);
        var wfEntityId = proxy.WorkflowEntitySearch (input.invoiceId);

        input.wfEntityId = wfEntityId;
        input.status = SOM.ST.Billing.Entities.PaymentPlanStatus.Activated;
        input.simulateMode = false;

        proxy.WritePaymentPlan (input);
    }

    public void DeletePaymentPlan (SOM.ST.Billing.Entities.WritePaymentPlanInput input) {
        var proxy = new SOM.ST.Billing.Business.InstalmentServiceProxy ();
        var wfEntityId = proxy.WorkflowEntitySearch (input.invoiceId);

        input.wfEntityId = wfEntityId;
        input.status = SOM.ST.Billing.Entities.PaymentPlanStatus.Deactivated;
        input.simulateMode = false;

        proxy.WritePaymentPlan (input);
    }

    public List<SOM.ST.Billing.Entities.PaymentPlanReadInstallment> GetPaymentPlan (string invoiceId, string paymentPlanId) {
        var proxy = new SOM.ST.Billing.Business.InstalmentServiceProxy ();
        var wfEntityId = proxy.WorkflowEntitySearch (invoiceId);

        return proxy.GetPaymentPlan (paymentPlanId, wfEntityId);
    }

