    public List<SOM.ST.Billing.Entities.TelephonyContract> GetCustomerTelephonyContracts (string customerId) {
        var contractServiceProxy = new SOM.ST.Billing.Business.ContractServiceProxy ();

        var customerContracts = contractServiceProxy.GetCustomerContracts (customerId, "");
        if (customerContracts == null || customerContracts.Count < 1)
            return null;

        var customerTelephonyContracts = new List<SOM.ST.Billing.Entities.TelephonyContract> ();

        for (int i = 0; i < customerContracts.Count; i++) {

            var contractInfo = contractServiceProxy.GetContractInfo (customerContracts[i].Id);

            if (String.Compare (contractInfo.Type, "Telephony") == 0) {
                var telephonyContract = new SOM.ST.Billing.Entities.TelephonyContract {
                Id = customerContracts[i].Id,
                CustomerId = customerContracts[i].CustomerId,
                Status = customerContracts[i].Status,
                ActivationDate = customerContracts[i].ActivationDate
                };

                var contractDetails = contractServiceProxy.GetContract (customerContracts[i].Id);
                if (contractDetails != null && contractDetails.StatusId != 4) {
                    var contractResources = contractServiceProxy.GetContractResources (customerContracts[i].Id);

                    if (contractResources == null)
                        throw new NullReferenceException (string.Format ("No contract resources found for contract with ID  '{0}'.", customerContracts[i].Id));

                    if (contractResources.Directories == null || contractResources.Directories.Count == 0)
                        throw new NullReferenceException (string.Format ("No directory number found for contract with ID  '{0}'.", customerContracts[i].Id));

                    telephonyContract.PhoneNumber = contractResources.Directories[0].Number;
                }

                customerTelephonyContracts.Add (telephonyContract);
            }
        }

        for (int i = 0; i < customerTelephonyContracts.Count; i++) {
            var contractDetails = contractServiceProxy.GetContract (customerTelephonyContracts[i].Id);
            customerTelephonyContracts[i].LastStatusChangeDate = contractDetails.LastStatusChangeDate;
            customerTelephonyContracts[i].RateplanId = contractDetails.RateplanId;
        }

        return customerTelephonyContracts;
    }

