    public List<SOM.ST.Billing.Entities.ContractAvailableService> GetContractAvailableServices (SOM.ST.Billing.Entities.GetContractAvailableServicesInput input) {
        if (input == null)
            throw new NullReferenceException ("input");
        if (string.IsNullOrEmpty (input.RatePlanId))
            throw new NullReferenceException ("input.RatePlanId");
        if (string.IsNullOrEmpty (input.ContractId))
            throw new NullReferenceException ("input.ContractId");
        if (string.IsNullOrEmpty (input.LinePathId))
            throw new NullReferenceException ("input.LinePathId");

        var inventoryServiceProxy = new Inventory.Business.InventoryServiceProxy ();
        var technicalDetails = inventoryServiceProxy.GetTechnicalDetailsByPath (input.LinePathId);
        if (technicalDetails == null)
            throw new NullReferenceException ("technicalDetails");

        var switchAvailableServices = inventoryServiceProxy.GetSwitchInfo (technicalDetails.SwitchId);

        var ratePlanServiceProxy = new SOM.ST.Billing.Business.RatePlanServiceProxy ();
        var allowedServicesByPackage = ratePlanServiceProxy.GetRatePlanAllowedServicesDictionary (input.RatePlanId);

        var commonServiceProxy = new SOM.ST.Billing.Business.CommonServiceProxy ();
        var contractServiceProxy = new SOM.ST.Billing.Business.ContractServiceProxy ();
        var existingContractService = contractServiceProxy.GetContractServices (input.ContractId);

        var filteredAllowedServices = new List<SOM.ST.Billing.Entities.ContractAvailableService> ();

        if (allowedServicesByPackage != null && allowedServicesByPackage.Count > 0 && switchAvailableServices != null && switchAvailableServices.Count > 0) {
            //if (allowedServicesByPackage != null && allowedServicesByPackage.Count > 0) {
            foreach (var allowedServicesKVP in allowedServicesByPackage) {
                var packageId = allowedServicesKVP.Key;
                var serviceServiceProxy = new SOM.ST.Billing.Business.ServiceServiceProxy ();
                var ratePlanPackageServices = serviceServiceProxy.GetServicesDefinitions (input.RatePlanId, packageId);

                foreach (var service in allowedServicesKVP.Value) {
                    if (input.ExcludedPackages != null && input.ExcludedPackages.Contains (packageId))
                        break;

                    //if (!switchAvailableServices.Contains (service))
                    //continue;

                    if (existingContractService != null && existingContractService.Any (itm => itm.Id == service && itm.Status != SOM.ST.Billing.Entities.ContractStatus.Deactivate))
                        continue;
                    var ratePlanService = ratePlanPackageServices.First (item => item.Id == service);

                    if (ratePlanService == null)
                        throw new NullReferenceException ("ratePlanService");

                    filteredAllowedServices.Add (new SOM.ST.Billing.Entities.ContractAvailableService {
                        Id = service,
                            Name = ratePlanService.Name,
                            PackageId = ratePlanService.PackageId,
                            NeedsProvisioning = ratePlanService.NeedsProvisioning,
                            IsNetwork = ratePlanService.IsNetwork,
                            SubscriptionFee = ratePlanService?.SubscriptionFee,
                            AccessFee = ratePlanService?.AccessFee
                    });
                }
            }
        }
        return filteredAllowedServices;
    }

