    public List<SOM.ST.Billing.Entities.CustomerContractService> GetContractServicesWithExcludedPackages (SOM.ST.Billing.Entities.GetContractServicesInput input) {
        if (input == null)
            throw new NullReferenceException ("input");

        if (string.IsNullOrEmpty (input.ContractId))
            throw new NullReferenceException ("input.ContractId");

        var contractServiceProxy = new SOM.ST.Billing.Business.ContractServiceProxy ();
        var contractServices = contractServiceProxy.GetContractServices (input.ContractId);

        if (contractServices == null || contractServices.Count == 0)
            return null;

        var contract = contractServiceProxy.GetContract (input.ContractId);
        if (contract == null)
            throw new NullReferenceException (string.Format ("Contract with Id  '{0}' not found.", input.ContractId));

        var commonServiceProxy = new SOM.ST.Billing.Business.CommonServiceProxy ();
        var serviceManager = new SOM.ST.Billing.Business.ServiceManager ();
        var packages = contractServices.Select (item => item.PackageId).Distinct ().ToList ();
        var filteredPackages = (input.ExcludedPackages != null && input.ExcludedPackages.Count > 0) ? packages.Except (input.ExcludedPackages) : packages;
        var services = serviceManager.GetServicesByRateplanAndPackages (new SOM.ST.Billing.Entities.GetServicesByRateplanAndPackagesInput { RatePlanId = contract.RateplanId, Packages = (filteredPackages != null) ? filteredPackages.ToList () : new List<string> () });

        var result = new List<SOM.ST.Billing.Entities.CustomerContractService> ();
        foreach (var contractService in contractServices) {
            if (contractService.Status == SOM.ST.Billing.Entities.ContractStatus.Deactivate)
                continue;

            if (input.ExcludedPackages != null && input.ExcludedPackages.Contains (contractService.PackageId))
                continue;

            var service = services.FirstOrDefault (item => string.Compare (item.Id, contractService.Id) == 0);
            contractService.Name = service.Name;
            result.Add (contractService);
        }

        return result;
    }

    public SOM.ST.Billing.Entities.TelephonyContractData GetTelephonyContract (string contractId) {
        var contractServiceProxy = new SOM.ST.Billing.Business.ContractServiceProxy ();

        var customerContracts = contractServiceProxy.GetCustomerContracts ("", contractId);
        if (customerContracts == null || customerContracts.Count < 1)
            return null;

        var contract = contractServiceProxy.GetContract (contractId);
        if (contract == null)
            return null;

        var contractInfo = contractServiceProxy.GetContractInfo (contractId);
        if (contractInfo == null)
            throw new NullReferenceException (string.Format ("No contract info found for contract with ID  '{0}'.", contractId));

        if (contractInfo.Type != "Telephony")
            throw new NullReferenceException (string.Format ("Contract with ID'{0}' is not a telephony contract.", contractId));

        var contractResources = contractServiceProxy.GetContractResources (contractId);
        if (contractResources == null)
            throw new NullReferenceException (string.Format ("No contract resources found for contract with ID  '{0}'.", contractId));

        if (contractResources.Ports == null || contractResources.Ports.Count == 0)
            throw new NullReferenceException (string.Format ("No port number found for contract with ID  '{0}'.", contractId));

        var installationAddress = contractServiceProxy.GetContractAddress (contractId);
        if (installationAddress == null)
            throw new NullReferenceException (string.Format ("No installation address found for contract  with ID  '{0}'.", contractId));

        var telephonyContractData = new SOM.ST.Billing.Entities.TelephonyContractData {
            Id = customerContracts[0].Id,
            CustomerId = customerContracts[0].CustomerId,
            RateplanId = contract.RateplanId,
            Status = customerContracts[0].Status,
            ActivationDate = customerContracts[0].ActivationDate,
            LinePathId = contractResources.Ports[0].Number,
            ContractAddress = installationAddress,
            IsBlocked = contractInfo.IsBlocked
        };

        telephonyContractData.CurrentBalance = GetContractBalance (contractId);

        var contractDetails = contractServiceProxy.GetContract (contractId);
        if (contractDetails != null && contractDetails.StatusId != 4) {
            if (contractResources.Directories == null || contractResources.Directories.Count == 0)
                throw new NullReferenceException (string.Format ("No directory number found for contract with ID  '{0}'.", contractId));

            telephonyContractData.PhoneNumber = contractResources.Directories[0].Number;
        }

        return telephonyContractData;
    }

    public List<SOM.ST.Billing.Entities.CustomerContractService> GetContractServices (string contractId) {
        if (contractId == null)
            throw new NullReferenceException ("ContractId");

        var contractServiceProxy = new SOM.ST.Billing.Business.ContractServiceProxy ();
        var contractServices = contractServiceProxy.GetContractServices (contractId);

        if (contractServices == null || contractServices.Count == 0)
            return null;

        var contract = contractServiceProxy.GetContract (contractId);
        if (contract == null)
            throw new NullReferenceException (string.Format ("Contract with Id  '{0}' not found.", contractId));

        var commonServiceProxy = new SOM.ST.Billing.Business.CommonServiceProxy ();
        var packages = contractServices.Select (item => item.PackageId).Distinct ().ToList ();

        var serviceManager = new SOM.ST.Billing.Business.ServiceManager ();
        var services = serviceManager.GetServicesByRateplanAndPackages (new SOM.ST.Billing.Entities.GetServicesByRateplanAndPackagesInput { RatePlanId = contract.RateplanId, Packages = packages });

        var filteredServices = new List<SOM.ST.Billing.Entities.CustomerContractService> ();
        foreach (var contractService in contractServices) {
            if (contractService.Status == SOM.ST.Billing.Entities.ContractStatus.Deactivate)
                continue;

            var service = services.FirstOrDefault (item => string.Compare (item.Id, contractService.Id) == 0);
            contractService.Name = service.Name;
            filteredServices.Add (contractService);
        }

        return filteredServices;
    }

