            var contractInfo = contractServiceProxy.GetContractInfo (contract.Id);

            if (contractInfo == null)
                throw new NullReferenceException (string.Format ("No contract info found for contract with ID  '{0}'.", contract.Id));

            if (String.Compare (contractInfo.Type, "Telephony") != 0)
