public List<SOM.ST.Billing.Entities.Invoice> GetCustomerSimulatedInvoices (string customerId, DateTime? from, DateTime? to) {
    var result = new List<SOM.ST.Billing.Entities.Invoice> ();
    var financialServiceProxy = new SOM.ST.Billing.Business.FinancialServiceProxy ();
    var billingAccountServiceProxy = new SOM.ST.Billing.Business.BillingAccountServiceProxy ();
    var paymentServiceProxy = new SOM.ST.Billing.Business.PaymentServiceProxy ();

    if (paymentServiceProxy.BillOnDemand (customerId, string.Empty, true)) {
       var billDocumentsRefrence = financialServiceProxy.GetBillDocumentsRefrences (customerId, from, to);

        if (billDocumentsRefrence != null && billDocumentsRefrence.Count > 0) {
            foreach (var item in billDocumentsRefrence) {
                if (item.Simulation) {
                    var billingAccountAssinment = billingAccountServiceProxy.GetBillingAccountAssignment (string.Empty, item.BillingAccountCode);

                    if (billingAccountAssinment == null)
                        throw new NullReferenceException (string.Format ("No billing account assignment with Id {0}", item.BillingAccountCode));

                    result.Add (new SOM.ST.Billing.Entities.Invoice () {
                        DocumentCode = item.DocumentRefrenceNb,
                            CustomerId = item.CustomerId,
                            BillingAccountCode = item.BillingAccountCode,
                            DocumentType = item.Type,
                            EntryDate = item.StartDate,
                            DueDate = item.EndDate,
                            ContractId = billingAccountAssinment.ContractId
                    });
                }
            }
        }
    }
    return result;
}
