{"$type":"Vanrise.Entities.VRNamespaceItemSettings, Vanrise.Entities","Code":{"$type":"Vanrise.Common.MainExtensions.VRDynamicCode.CustomCodeDynamicCodeSettings, Vanrise.Common.MainExtensions","ConfigId":"bdd289df-573c-44a1-9a95-d0de2ed9dd71","CustomCode":"public class ServiceManager {

    public List<SOM.ST.Billing.Entities.ServiceDefinition> GetServicesByRateplanAndPackages (SOM.ST.Billing.Entities.GetServicesByRateplanAndPackagesInput input) {
        if (input == null)
            throw new NullReferenceException ("input");
        if (input.RatePlanId == null)
            throw new NullReferenceException ("input.RatePlanId");
        if (input.Packages == null)
            throw new NullReferenceException ("input.Packages");

        var commonServiceProxy = new SOM.ST.Billing.Business.CommonServiceProxy ();
        var serviceServiceProxy =  new SOM.ST.Billing.Business.ServiceServiceProxy();
        var result = new List<SOM.ST.Billing.Entities.ServiceDefinition> ();

        for (int i = 0; i < input.Packages.Count; i++) {
            var listOfServices = serviceServiceProxy.GetServicesDefinitions (input.RatePlanId, input.Packages[i]);
            if (listOfServices != null && listOfServices.Count > 0) {
                /*if (input.OnlyCoreServices)
                {
                    var listOfCoreServices = listOfServices.Where(item => item.IsCore);
                    if (listOfCoreServices != null && listOfCoreServices.Any())
                        result.AddRange(listOfCoreServices);
                }
                else*/
                result.AddRange (listOfServices);
            }
        }

        return result;
    }

    public bool IsServiceContracted (string contractId, string serviceId) {
        if (contractId == null)
            throw new NullReferenceException ("ContractId");

        if (serviceId == null)
            throw new NullReferenceException ("ServiceId");

        var contractServiceProxy = new SOM.ST.Billing.Business.ContractServiceProxy ();
        var contractServices = contractServiceProxy.GetContractServices (contractId);

        if (contractServices == null || contractServices.Count == 0)
            return false;

        return contractServices.Any (item => string.Compare (item.Id, serviceId) == 0 && item.Status == SOM.ST.Billing.Entities.ContractStatus.Activate);
    }
}"}}

{"$type":"Vanrise.Entities.VRNamespaceItemSettings, Vanrise.Entities","Code":{"$type":"Vanrise.Common.MainExtensions.VRDynamicCode.CustomCodeDynamicCodeSettings, Vanrise.Common.MainExtensions","ConfigId":"bdd289df-573c-44a1-9a95-d0de2ed9dd71","CustomCode":"public class RateplanManager {

    public List<SOM.ST.Billing.Entities.ServiceDefinition> GetRatePlanServices (SOM.ST.Billing.Entities.GetRatePlanAllowedServicesInput input) {
        if (input == null)
            throw new NullReferenceException ("input");
        if (string.IsNullOrEmpty (input.RatePlanId))
            throw new NullReferenceException ("input.RatePlanId");
        if (string.IsNullOrEmpty (input.SwitchId))
            throw new NullReferenceException ("input.SwitchId");

        var commonServiceProxy = new SOM.ST.Billing.Business.CommonServiceProxy ();
        var ratePlanServiceProxy = new SOM.ST.Billing.Business.RatePlanServiceProxy ();
        var inventoryServiceProxy = new Inventory.Business.InventoryServiceProxy ();

        var filteredAllowedServices = new List<SOM.ST.Billing.Entities.ServiceDefinition> ();

        var allowedServicesDictionary = ratePlanServiceProxy.GetRatePlanAllowedServicesDictionary (input.RatePlanId);
        var switchAvailableServices = inventoryServiceProxy.GetSwitchInfo (input.SwitchId);

        if (allowedServicesDictionary != null) // && switchAvailableServices != null && switchAvailableServices.Count > 0)
        {
            foreach (var allowedServicesKvp in allowedServicesDictionary) {
                var packageId = allowedServicesKvp.Key;

                if (input.ExcludedPackages != null && input.ExcludedPackages.Contains (packageId))
                    continue;

                var services = allowedServicesKvp.Value;

                var serviceServiceProxy = new SOM.ST.Billing.Business.ServiceServiceProxy();
                var ratePlanServices = serviceServiceProxy.GetServicesDefinitions (input.RatePlanId, packageId);
                for (int i = 0; i < services.Count; i++) {
                    //if (!switchAvailableServices.Contains(services[i]))
                    // continue;

                    var ratePlanService = ratePlanServices.FirstOrDefault (item => string.Compare (item.Id, services[i]) == 0);

                    filteredAllowedServices.Add (new SOM.ST.Billing.Entities.ServiceDefinition {
                        Id = services[i],
                            Name = ratePlanService?.Name,
                            PackageId = packageId,
                            SubscriptionFee = ratePlanService?.SubscriptionFee,
                            AccessFee = ratePlanService?.AccessFee
                    });
                }
            }
        }
        return filteredAllowedServices;
    }

}"}}

