        SOM.ST.Billing.Entities.TelephonyContractInfo pilotContract = null;

        for (int i = 0; i < customerContracts.Count; i++) {
            if (customerContracts[i].Status != 2)
                continue;

            if (string.Compare (customerContracts[i].Id, contractId) == 0) {
                pilotContract = new SOM.ST.Billing.Entities.TelephonyContractInfo { Id = customerContracts[i].Id, PhoneNumber = customerContracts[i].PhoneNumber };
