            var contractInfo = contractServiceProxy.GetContractInfo (customerContracts[i].Id);

            if (String.Compare (contractInfo.Type, "Telephony") == 0) {
                telephonyCustomerContracts.Add (new SOM.ST.Billing.Entities.TelephonyContractInfo { Id = customerContracts[i].Id, PhoneNumber = customerContracts[i].PhoneNumber });
            }
        }

        if (pilotContract == null)
            throw new NullReferenceException (string.Format ("Contract with id '{0}' not found.", contractId));

        if (pilotContract.PhoneNumber == null)
            throw new NullReferenceException ("pilotContract.PhoneNumber");

