    public SOM.ST.Billing.Entities.PabxContract GetPabxContract (string contractId, string phoneNumber) {
        var contractServiceProxy = new SOM.ST.Billing.Business.ContractServiceProxy ();
        var inventoryServiceProxy = new Inventory.Business.InventoryServiceProxy ();

        var address = contractServiceProxy.GetContractAddress (contractId);
        var deviceId = inventoryServiceProxy.GetDeviceID (phoneNumber);

        return new SOM.ST.Billing.Entities.PabxContract { Id = contractId, PhoneNumber = phoneNumber, Address = address, DeviceId = deviceId };
