    public bool IsSecondaryPABXContract (string contractId) {
        if (string.IsNullOrEmpty (contractId))
            throw new NullReferenceException ("ContractId");

        var contractServiceProxy = new SOM.ST.Billing.Business.ContractServiceProxy ();
        var contractInfo = contractServiceProxy.GetContractInfo (contractId);
        if (contractInfo == null)
            throw new NullReferenceException (string.Format ("No contract info found for contract with Id '{0}'.", contractId));

        return (!string.IsNullOrEmpty (contractInfo.PABXPilotContractId));
    }
