{"$type":"Vanrise.Entities.VRNamespaceItemSettings, Vanrise.Entities","Code":{"$type":"Vanrise.Common.MainExtensions.VRDynamicCode.CustomCodeDynamicCodeSettings, Vanrise.Common.MainExtensions","ConfigId":"bdd289df-573c-44a1-9a95-d0de2ed9dd71","CustomCode":"public class InventoryManager {

    public Inventory.Entities.SwitchType? GetSwitchType (string phoneNumber, string linePathId) {
        var inventoryServiceProxy = new Inventory.Business.InventoryServiceProxy ();
        var inventoryPhoneItem = new Inventory.Business.InventoryPhoneItem ();

        if (!String.IsNullOrEmpty (phoneNumber))
            inventoryPhoneItem = inventoryServiceProxy.GetTechnicalDetails (phoneNumber);
        else
        if (!String.IsNullOrEmpty (linePathId))
            inventoryPhoneItem = inventoryServiceProxy.GetTechnicalDetailsByPath (linePathId);

        if (inventoryPhoneItem == null)
            return null;
        else {
            if (inventoryPhoneItem.SWITCH_TYPE == "Automatic")
                return Inventory.Entities.SwitchType.Automatic;
            else {
                if (String.IsNullOrEmpty (inventoryPhoneItem.SwitchOMC))
                    return Inventory.Entities.SwitchType.Manual;

                else
                    return Inventory.Entities.SwitchType.ManualWithOMC;
            }
        }
    }

}"}}

